import React from 'react';
import './App.css';
import TextField from "@material-ui/core/TextField";



class GetStarted extends React.Component {

  state = {
    ptp_list : []
  }

  addPtp = (value) => {
    new_ptp_list = this.state.ptp_list.push(value)
    this.state.ptp_list = new_ptp_list
  }

  render(){
    return (
      <div className="App">
        <h1> GETTING STARTED </h1>
        <br/>
        <TextField
          id="outlined-helperText"
          label=""
          placeholder="Name"
          helperText="Nothing"
          variant="outlined"
          onChange={e =>
            this.addPtp( e.target.value)
          }
        />

        <div> Ptp list len: {this.state.ptp_list.length }</div>
      </div>
    );
  }

}

export default GetStarted;
